import React from 'react'

function AppTodoList({ SetMyList, myList }) {
    console.log(myList)

    const handelClick = (index) => {
        SetMyList([...myList, myList[index] =  {
            complete : true,
            value : myList[index].value
        } ])
    }

    return (
    <div>

        {myList.map((myList, index) => (
            <div key={index} onClick={handelClick(index)}> {myList.value} </div>
        ))}
    </div>
  )
}

export default AppTodoList
